import React, { Component } from 'react'
import Timeline from 'react-image-timeline';
import events2 from '../events2.json'
require('react-image-timeline/dist/timeline.css');

events2 = {
    date: new Date(2013, 9, 27),
    text: "Sed leo elit, pellentesque sit amet congue quis, ornare nec lorem.",
    title: "Cairo, Egypt",
    buttonText: 'Click Me',
    imageUrl: "http://github.com/aaron9000/react-image-timeline/blob/master/src/assets/cairo.jpg?raw=true",
    onClick: () => {
        console.log('hello');
    }
}
export class Timeline2 extends Component {
  render() {
    return (
        <div id="timeline">
        <h1> header </h1>
        <Timeline events={events2} />
              </div>
    )
  }
}

export default Timeline2
